import React from 'react'
import postImg from "./post-img.jpg";
import "./post.css";

const Post = ({post}) => {
  return (
    <div className='post'>
          <img src={postImg} alt='post-im' />
          <p className='post-category'><span>sports</span>, <span>health</span></p>
      <p className='post-title'>{ post.title }</p>
      <p className='post-desc'>{ post.desc }</p>
    </div>
  )
}

export default Post
